import Header from './Header'; 
import Content from './Content'; 
import Footer from './Footer'; 


function App() {

  return (

  <div className='background-image'>
        <svg viewBox='0 0 500 100000' xmlns='http://www.w3.org/2000/svg'>
      <filter id='noiseFilter'>
        <feTurbulence 
          type='fractalNoise' 
          baseFrequency='0.65' 
          numOctaves='3' 
          stitchTiles='stitch'/>
      </filter>

      <rect width='100%' height='100%' filter='url(#noiseFilter)'/>
    </svg>

    <div className='App'>
      <Header />
      <Content />
      <Footer />
    </div>

  </div>

  )
}

export default App;
